import { Navbar, Container, Nav, Card, Button, Carousel } from 'react-bootstrap';
import React, { useEffect, useState } from 'react'
import axios from 'axios';
import './App.css';
import './main.css';



function App() {

	var [top10, top10_change] = useState([1, 2, 3]);
	var [page, page_change] = useState(1);
	useEffect(() => {
		axios.get('https://kobis.or.kr/kobisopenapi/webservice/rest/boxoffice/searchDailyBoxOfficeList.json', {
			params : {
				key : '36fcb6727085802f6401dc96e6743cf4',
				targetDt : 20211002,
			},
			// headers : headers,
		}).then(resonse => {
			var json = resonse.data.boxOfficeResult.dailyBoxOfficeList

			top10_change(json);
			// console.log(resonse.data.boxOfficeResult.dailyBoxOfficeList);
		}).catch( error => {
			console.log(error);
		})

	}, [page]);


	return (
		<div className="App">
			<Navbar bg="dark" variant="dark">
				<Container className='text-center'>
					<Navbar.Brand href="#home">MOVIEDIC</Navbar.Brand>
						<Nav className="me-auto">
						<Nav.Link href="#home">HOME</Nav.Link>
						<Nav.Link href="#features">BOXOFFICE</Nav.Link>
						<Nav.Link href="#pricing">HISTORY</Nav.Link>
						<Nav.Link href="#pricing">MY</Nav.Link>
					</Nav>
				</Container>
			</Navbar>


			<CaroselSet />


			<div className="container mt-4">
				<h4 className="text-center">List</h4>
				<div className="boxoffice mt-4">
					{
						top10.map((movie, i) => {
							return (
								<Card className="boxoffice-card" >
									<Card.Img variant="top" src="holder.js/100px180" />
									<Card.Body>
										<Card.Title>Card Title</Card.Title>
										<Card.Text>
										Some quick example text to build on the card title and make up the bulk of
										the card's content.
										</Card.Text>
										<Button variant="primary">Go somewhere</Button>
									</Card.Body>
								</Card>
							)
						})
					}
				</div>
			</div>
		</div>
	);
}

function CaroselSet() {
	return (<Carousel>
		<Carousel.Item>
			<img
			className="d-block w-100"
			src="holder.js/800x400?text=First slide&bg=373940"
			alt="First slide"
			/>
			<Carousel.Caption>
			<h3>First slide label</h3>
			<p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
			</Carousel.Caption>
		</Carousel.Item>
		<Carousel.Item>
			<img
			className="d-block w-100"
			src="holder.js/800x400?text=Second slide&bg=282c34"
			alt="Second slide"
			/>

			<Carousel.Caption>
			<h3>Second slide label</h3>
			<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
			</Carousel.Caption>
		</Carousel.Item>
		<Carousel.Item>
			<img
			className="d-block w-100"
			src="holder.js/800x400?text=Third slide&bg=20232a"
			alt="Third slide"
			/>

			<Carousel.Caption>
			<h3>Third slide label</h3>
			<p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
			</Carousel.Caption>
		</Carousel.Item>
	</Carousel>)
}

export default App;
